import axios from 'axios';
import { userData } from '../redux/reducers/RideSlice';

const ApiUser = async (setRides) => {
    await axios
            .get('https://assessment.api.vweb.app/user')
            .then( res => setRides(userData({user_data:res.data})) )
} 

export default ApiUser;
